import React from "react";

const BookItem = (props) => {
    return(
        <li>
                <h2>{props.title}</h2>
                <div>{props.author}</div>
                <div>{props.publicationDate}</div>
                <div>{props.genre}</div>
        </li>
    )
}

export default BookItem;
